const NavBarRigth = () => {
  return (
    <div className="navRigth">
      <div className="containerEmail">
        <a
          target="_blank"
          rel="noopener noreferrer"
          href="mailto:reymelrey.mislang@gmail.com"
        >
          reymelrey.mislang@gmail.com
        </a>
      </div>
    </div>
  );
};

export default NavBarRigth;
